import React, { Component } from "react";

export class ClassClick extends Component {
  clickHandler() {
    console.log("clicked the button");
  }
  render() {
    return (
      <div>
        <button onClick={this.clickHandler}>clickme bro</button>
      </div>
    );
  }
}

export default ClassClick;
